import { Component } from "react"

class Home extends Component {

    state = {
        test: 1
    }

    onClick = (_) => {
        var test = this.state.test + 1
        this.setState({test})
    }

    render() {
        return (
            <button onClick={this.onClick}>
                {this.state.test}
            </button>
        )
    }

}

export default Home;
